import React from 'react'
import './Posts.css'
import { PostData } from '../../Data/PostData'

const Posts = () => {
    return (
        <div className="Posts">
            {PostData.map((post, id) => {
                return <Post />
            })}
        </div>
    )
}

export default Posts
